import Head from "next/head";
const Meta = () => {
  return (
    <Head>
      <meta name="viewport" content="width=device-width, initial-scale=1" />
      <meta charSet="utf-8" />
      <link rel="shortcut icon" href="./public/favicon.png" />
      <title>Sign Up</title>
    </Head>
  );
};

export default Meta;
